import React from 'react';
import {  Figure } from 'react-bootstrap';


const FollowersCard = (props) => {


    return (
      <div>
        <Figure>

            <div>
                <img
                width={110}
                height={120}
                src={props.img} roundedCircle/> 
                <a href={props.html_url}></a>
                <h3>{props.login}</h3>


            </div>

        </Figure>
      </div>
    );
}

export default FollowersCard;
